import './news.less';
export default function News() {
  const tabsList = [
    {
      name: '全部新闻',
      id: 0,
    },
    {
      name: '企业咨询',
      id: 1,
    },
    {
      name: '生态合作',
      id: 2,
    },
    {
      name: '产品技术',
      id: 3,
    },
    {
      name: '公司活动',
      id: 4,
    },
    {
      name: '下载中心',
      id: 5,
    },
  ];
  return (
    <div className="main">
      <div className="main-bg">
        <div className="news-banner">
          <img src="/static/news-banner.png" />
          <p>新闻中心</p>
        </div>
        <div className="news-tabs">
          {tabsList.map((item) => {
            return <a key={item.id}>{item.name}</a>;
          })}
        </div>
      </div>
    </div>
  );
}
